import Link from 'next/link';

const linkStyle = {
    marginRight: 15,
};

const headerStyle = {
    border: '1px solid #DDD',
    padding: '5px',
    width: '100%'
}

const Header = () => (
    <div style={headerStyle}>

        <Link href="/">
            <a style={linkStyle}>Search again</a>
        </Link>


        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>
    </div>
);

export default Header;
